<p>Les équipes Espaces Verts font de l’entretien, de la création d’espaces verts, de l’élagage pour des collectivités publiques, des entreprises, des particuliers. Chaque équipe intervient quotidiennement sur divers chantiers. </p>
<p>Le champ d’intervention est d’environ 60 km autour de Montpellier.</p>
<p>Les équipements et le matériel professionnels utilisés permettent de réaliser les prestations dans des conditions de travail optimales de sécurité et de qualité. L’ensemble des moniteurs a été certifié concernant l’emploi de produits phytosanitaires. Les moyens techniques mis à disposition sont identiques aux entreprises et aux artisans paysagistes.</p>
<p>L’activité Espaces Verts adhère aux principes de développement durable en menant des actions concrètes de valorisation des déchets verts, d’une utilisation raisonnée des produits phytosanitaires, d’une réduction du gaspillage d’eau.</p>
